import React from 'react'


const Display=(props)=> 
{

   const resultdata=(i)=>{       

    let { pic }=Routing[i]

        return(<> 
                <img src={ pic }  className="w-100" style={{ height:'600px' }} />
            </>); 
    
    }


    switch(props.match.params.id) 
    {
        case '1': return(<> {resultdata(0)} </>); break;
        case '2': return(<> {resultdata(1)} </>); break;
        case '3': return(<> {resultdata(2)} </>); break;
        case '4': return(<> {resultdata(3)} </>); break;
        default: return(<Pagenotfound />); break;
    }

}

export default Display;
